import axinos from 'axios';

const url = 'https://covid19.mathdro.id/api'


export const fetchData = async () => {
    // try{
    const response = await axinos.get(url);
    const confirmed = response.data.confirmed.value;
    const recovered = response.data.recovered.value;
    const deaths = response.data.deaths.value;
    const lastUpdate = response.data.lastUpdate.value;
    const modified_response = {
        'confirmed': confirmed,
        'recovered': recovered,
        'deaths': deaths,
        'lastUpdate': lastUpdate 
    };

    return modified_response;
    // } catch{
    //     console.log("err");
    // }
}
